{
  "output": "(:action navigate_to
  :parameters (?objto - object ?agent - agent)
  :precondition (not (in_reach_of_agent ?objto))
  :effect (and (in_reach_of_agent ?objto) 
                (forall 
                    (?objfrom - object) 
                    (when 
                        (and 
                            (in_reach_of_agent ?objfrom) 
                            (not (same_obj ?objfrom ?objto))
                        )
                        (not (in_reach_of_agent ?objfrom))
                    )
                )
            )
)
(:action place_onfloor
  :parameters (?obj_in_hand - object ?floor - floor_n_01 ?agent - agent)
  :precondition (and (holding ?obj_in_hand) (in_reach_of_agent ?floor))
  :effect (and (onfloor ?obj_in_hand ?floor) (not (holding ?obj_in_hand)) (not (handsfull ?agent)))
)
(:action grasp
  :parameters (?obj - object ?agent - agent)
  :precondition (and (not (holding ?obj)) (not (handsfull ?agent)) (in_reach_of_agent ?obj) (not (exists (?obj2 - object) (and (inside ?obj ?obj2) (not (open ?obj2))))))
  :effect (and (holding ?obj) (handsfull ?agent) (forall (?other_obj - object) (and (not (inside ?obj ?other_obj)) (not (ontop ?obj ?other_obj)) (not (under ?obj ?other_obj)) (not (under ?other_obj ?obj)) (not (nextto ?obj ?other_obj)) (not (nextto ?other_obj ?obj)) (not (onfloor ?obj ?other_obj)))))
)"
}

